% move=1;
% params.N_L=5;
% 
% params.cf=1;
% params.numTX=4;
% params.numRX=4;
% params.Ny=4;
% params.snr=20;
% 
% 
% 
% [theta,phi]=plane_move_run_optimized(params,move);
res_phi(n,s,:)-phi' %[output:2f6651c2]
%%
N_L=[1,5,7,11,15];
snr=[40,20,1,-5];
theta=31:40;
phi=-59:-50;
plot(phi-squeeze(res_phi(1,1,:))) %[output:45f0179f]
%%

figure; %[output:09581e01]
for s = 1:length(snr) %[output:group:3178dbd7]
    subplot(2,2,s); % 创建2x2子图布局 %[output:09581e01]
    hold on;
    % s=1;
    % 绘制不同N_L的曲线
    for n = 1:length(N_L)
        plot(phi, squeeze(res_phi(n,s,:))-phi',...
            'LineWidth',1.5,...
            'DisplayName',['N_L=',num2str(N_L(n))]);
    end
    
    title(['SNR = ',num2str(snr(s))]);
    xlabel('PHI (degrees)');
    ylabel('res_phi');
    grid on;
    legend('Location','best');
    hold off;
end %[output:group:3178dbd7]
%%
figure; %[output:341f6416]
for s = 1:length(snr) %[output:group:72791ffc]
    subplot(2,2,s); % 创建2x2子图布局 %[output:341f6416]
    hold on;
    % s=1;
    % 绘制不同N_L的曲线
    for n = 1:length(N_L)
        plot(theta, squeeze(res_theta(n,s,:))-theta',...
            'LineWidth',1.5,...
            'DisplayName',['N_L=',num2str(N_L(n))]);
    end
    
    title(['SNR = ',num2str(snr(s))]);
    xlabel('theta (degrees)');
    ylabel('res_phi');
    grid on;
    legend('Location','best');
    hold off;
end %[output:group:72791ffc]
%%
squeeze(res_theta(n,:,1))-theta(1) %[output:77b30cd3]
%%
figure; %[output:1ec18633]
% for s = 1:length(snr)
    % subplot(2,2,s); % 创建2x2子图布局
    hold on; %[output:1ec18633]
    % s=1;
    % 绘制不同N_L的曲线
    for n = 1:length(N_L)
        plot(snr, squeeze(res_phi(n,:,1))-phi(1),... %[output:1ec18633]
            'LineWidth',1.5,... %[output:1ec18633]
            'DisplayName',['N_L=',num2str(N_L(n))]); %[output:1ec18633]
    end
    
    title(['SNR = ',num2str(snr(s))]); %[output:1ec18633]
    xlabel('theta (degrees)'); %[output:1ec18633]
    ylabel('res_phi'); %[output:1ec18633]
    grid on; %[output:1ec18633]
    legend('Location','best'); %[output:1ec18633]
    hold off; %[output:1ec18633]
% end
